        internal static GeodeticDatum FromID(string ID)
        {
            try
            {
                if (_datums.Count == 0)
                {
                    FillDatumList();
                }

                int id = int.Parse(ID);
                GeodeticDatum datum;
                if (_datums.TryGetValue(id, out datum))
                {
                    return datum;
                }
            }
            catch { }
            return null;
        }
